import logo from './logo.svg';
import './style.scss';
import React from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://api.weatherapi.com/v1/current.json?key=3c442cda80554ddeb7b122258212411&q=London&aqi=no`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }


  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.lat}</li>)}
      </ul>
    )
  }
}
